    false,nt"url": null,nt"notes": "Final environmental assessment for the
    grazing management within the Seven Blackfeet Habitat Unit of the Charles M. Russell
    National Wildlife Refuge, in relation to attaining habitat goals for wildlife.  The
    Service has chosen the Proposed Action  of Prescriptive Grazing. Livestock grazing
    will occur only as a prescriptive tool to achieve specific wildlife habitat objectives
    and to utilize forage not needed by primary and secondary wildlife. The season of
    use, AUM number, and grazing frequency will be based on the amount of grass (forage)
    that can be removed without negatively impacting the attainment of wildlife habitat
    objectives.Enclosed is the Finding of No Significant Impact and Decision Record,
    the Public Comment Summary, the revised Environmental Assessment, the Compatibility
    Determination, and the Endangered Species Section 7 Consultation.",nt"license_title":
